// Assuming unixTime is the Unix time in milliseconds
function unixTimeToSQLTimestamp(unixTime) {
    // Create a new Date object using the Unix time
    const date = new Date(unixTime);

    // Extract year, month, day, hour, minute, and second components
    const year = date.getFullYear();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    const hours = String(date.getHours()).padStart(2, '0');
    const minutes = String(date.getMinutes()).padStart(2, '0');
    const seconds = String(date.getSeconds()).padStart(2, '0');

    // Format the SQL timestamp
    const sqlTimestamp = `${year}-${month}-${day} ${hours}:${minutes}:${seconds}`;

    return sqlTimestamp;
}
function convert_to_sql_timestamp(date_str) {
    // Split the date string into its components.
    const date_parts = date_str.split(", ");
    const date = date_parts[0].split(".");
    const time = date_parts[1].split(":");

    // Create a JavaScript Date object from the components.
    const dt = new Date(date[2], date[1] - 1, date[0], time[0], time[1]);

    // Convert the JavaScript Date object to a SQL timestamp string.
    return dt.toISOString().slice(0, 19).replace('T', ' ');
}

