    const umlautMap = {
        "&auml;": "ä",
        "&Auml;": "Ä",
        "&ouml;": "ö",
        "&Ouml;": "Ö",
        "&uuml;": "ü",
        "&Uuml;": "Ü",
        "&szlig;": "ß"
        // Add more entities and corresponding characters as needed
    };

    // Replace each HTML entity with its corresponding character
    for (let entity in umlautMap) {
        const regex = new RegExp(entity, "g");
        htmlString = htmlString.replace(regex, umlautMap[entity]);
    }

    return htmlString;
}

